import React from 'react';
import {Link} from 'react-router-dom'
import axios from 'axios';

const TestAPI = () => {

  function post() {
    axios.post('https://dogfair.herokuapp.com/api/license_registrations', {
    name: 'moonmoon',
    age: 2,
    description: 'moon moon is one of the most famous doggo in the internet',
    doggo_id: 'J123456a'
  })
  .then((response) => {
    console.log(response)
  }, (error) => {
    console.log(error)
  })
  }
  return(
    <div>
      <button className="button is-primary" onClick={post}>push change</button>
    </div>
  )
}

function Registration () {
  // sending a post request
  return (
    <div className="container">
      <TestAPI />
      <div className="reg-container">
        <p>Doggo Registration</p>
        <div className="column">
          <input className="input" type="text" placeholder="Name" />
        </div>
        <div className="column">
          <input className="input" type="number" placeholder="Age" />
        </div>
        <div className="column">
          <input className="input" type="text" placeholder="Description" />
        </div>
        <div className="column">
          <input className="input" type="text" placeholder="Doggo id (Unique)" />
        </div>
        <Link to="/doggo-list"><button className="button is-primary">Submit</button></Link>
      </div>
    </div>
  );
}

export default Registration;
